ControlPropertyState.AutoRuleBindingString:
With(
    {
        weekHours: {
            From: droWeekFromHour_GeneralDataForm.Selected.Value,
            To: droWeekToHour_GeneralDataForm.Selected.Value
        },
        saturdayHours: If(
            togEnableSaturday_GeneralDataForm.Value,
            {
                From: droSaturdayFromHour_GeneralDataForm.Selected.Value,
                To: droSaturdayToHour_GeneralDataForm.Selected.Value
            },
            Blank()
        )
    },
    With(
        {
            weekHoursNumbers: {
                From: Split(
                    weekHours.From,
                    ":"
                ),
                To: Split(
                    weekHours.To,
                    ":"
                )
            },
            saturdayHoursNumbers: If(
                IsBlank(saturdayHours),
                Blank(),
                {
                    From: Split(
                        saturdayHours.From,
                        ":"
                    ),
                    To: Split(
                        saturdayHours.To,
                        ":"
                    )
                }
            )
        },
        With(
            {
                weekHoursIsValid: true,
                saturdayHoursIsValid: true
            },
            {
                Value: $"Monday to Friday: {weekHours.From} to {weekHours.To}, {If(
                    IsBlank(saturdayHours),
                    "",
                    $"Saturday: {saturdayHours.From} to {saturdayHours.To}"
                )}",
                WeekHoursIsValid: weekHoursIsValid,
                SaturdayHoursIsValid: saturdayHoursIsValid,
                IsValid: weekHoursIsValid && saturdayHoursIsValid
            }
        )
    )
)
